import { icon } from '@fortawesome/fontawesome-svg-core';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import React from 'react';
import "./HistoryIcon.css"
class HistoryIcon extends React.Component {
    state={
        icon:[
            {
                music: "music",
                play: "play-circle",
                different:"ellipsis-h"
            }
        ]
    }
    render() {
        return (
            <>
                <div className="HistoryIcon">
                    <a href="123" className="history-link-icon">
                        <FontAwesomeIcon className="HistoryIcon" icon={['fab','{this.state.icon.music}' ]}/>
                    </a>
                    <a href="123" className="history-link-icon">
                        <FontAwesomeIcon className="HistoryIcon" icon={icon.music}/>
                    </a>
                    <a href="123" className="history-link-icon">
                        <FontAwesomeIcon className="HistoryIcon" icon={icon.diffent}/>
                    </a>
                </div>
            </>
        );
    }
}

export default HistoryIcon;
